import React from 'react'
import './page-icon.css'

const PageIcon = ({imageURL,pageName, currentPage, switchPage}) => {
     const elements = [
          <div className='page-name' onClick={switchPage}>{pageName}</div>
     ]
     if (currentPage === pageName) {
          elements.push(<img src = {imageURL} width = '40px' height = 'auto' style={{border: "2px solid green"}}/>)
     }
     else elements.push(<img src = {imageURL} width = '40px' height = 'auto' />)
     return (
          <div className='icon-container'>
               {elements}
          </div>
     )
}

export default PageIcon
